INSERT INTO `product` VALUES ('2', 'Andromax E2', '1', '<p class=MsoNormal><b>Spesifikasi :</b></p>\r\n\r\n<span lang=IN>4.5” FWVGA Bright LCD</span><br/>\r\n\r\n<span lang=IN>Quad Core 1.3 Ghz </span><br/>\r\n\r\n<span lang=IN>Qualcomm Snapdragon</span><br/>\r\n\r\n<span lang=IN>OS 5 (Lollipop)</span><br/>\r\n\r\n<span lang=IN>1GB RAM + 8GB ROM</span><br/>\r\n\r\n<span lang=IN>Dual Camera Dual LED </span><br/>\r\n\r\n<span lang=IN>5MP AF + 5MP w LED</span><br/>\r\n\r\n<span lang=IN>2000 mAh</span><br/>\r\n\r\n<span lang=IN>VOLTE Ready</span><br/>\r\n\r\n<span lang=IN>Smart Gesture + DTS </span><br/>\r\n\r\n<p class=MsoNormal>&nbsp;</p>\r\n\r\n<p class=MsoNormal><b>Benefit:</b><br>\r\nBonus Kuota 17 GB*<br>\r\nBonus 2GB + 6GB Internet Malam **<br>\r\n10 Menit Nelpon ke semua operator&nbsp; <br>\r\n1000 Menit ke sesama Smartfren <br>\r\n100 SMS ke semua operator</p>\r\n\r\n<p class=MsoNormal>&nbsp;</p>\r\n\r\n<p class=MsoNormal><b>Note :</b><b> </b></p>\r\n\r\n*&nbsp;Bonus didapat dengan melakukan isi ulang pertama\r\nsenilai min 100 Ribu <br/>\r\n\r\nBonus kuota dapat digunakan 24 jam dan berlaku 17 hari sejak\r\npengisian ulang pertama dilakukan <br/>\r\n\r\nBonus kuota hanya berlaku satu kali dan tidak dapat\r\ndiakumulasi dengan kuota lainnya <br/>\r\n\r\nPeriode promo 10-31 Agustus 2016<br/>\r\n\r\n** Bonus 2 GB + 6 GB (internet Malam) berlaku 30 hari sejak\r\npengisian ulang pertama di lakukan.<br/>\r\n\r\nTotal Bonus yang didapat setelah melakukan isi ulang pertama\r\nsenilai min 100 Ribu adalah 17 GB + 2 GB + 6 GB (internet malam)</p>', 'assets/img/product/andromax_e2/image.png', '13', 'active', '2016-08-22 09:18:08', 'System', '2016-08-22 09:18:08', 'System');
