INSERT INTO `product` VALUES ('14', 'New Andromax M3Y', '2', '<b>Spesifikasi:</b><br/>\r\n\r\nModem WiFi LTE Cat4<br/>\r\n\r\nChipset Qualcomm MDM 9307<br/>\r\n\r\nWiFi 802.11 b/g/n<br/>\r\n\r\nSupport up to 32 users connections<br/>\r\n\r\nBattery 3000mAH<br/>\r\n\r\nMicroSD Slot, support up to 32GB<br/>\r\n\r\nWireless Storage Function<br/>\r\n\r\nWPS button<br/>\r\n\r\nUser Friendly Apps using MyLink M3Y<br/>\r\n\r\n (available in iOS and Android)<br/>\r\n\r\n MySmartfren Apps for checking                  <br/>\r\n\r\nbalance, quota &amp; active period<br/>\r\n\r\nColor Options:<br/>\r\n\r\nBlack &amp; White<br/>\r\n\r\n<p class=MsoNormal>&nbsp;</p>\r\n\r\n<p class=MsoNormal><b>Benefit:</b><br/>\r\n\r\nFree Big Quota 30GB valid for 30 Days First Activation<br/>\r\n\r\n<p class=MsoNormal>&nbsp;</p>\r\n\r\n<p class=MsoNormal><b>Note:</b><br/>\r\n\r\nTop up Min 100 K Free Quota tambahan 2GB untuk 12X pengisian\r\natau 12 bulan mana lebih dahulu </p>', 'assets/img/product/new_andromax_m3y/image.png', '3', 'active', '2016-08-26 14:14:13', 'System', '2016-08-26 14:14:13', 'System');
INSERT INTO `product` VALUES ('15', 'New Andromax M3Z', '2', '<b>Spesifikasi:</b><br/>\r\n\r\nModem WiFi LTE Cat4<br/>\r\n\r\nChipset Qualcomm MDM 9307<br/>\r\n\r\nWiFi 802.11 b/g/n<br/>\r\n\r\nSupport up to 32 users connections<br/>\r\n\r\nBattery 3000mAH<br/>\r\n\r\nMicroSD Slot, support up to 32GB<br/>\r\n\r\nWireless Storage Function<br/>\r\n\r\nWPS button<br/>\r\n\r\nUser Friendly Apps using MyLink M3Y<br/>\r\n\r\n (available in iOS and Android)<br/>\r\n\r\nMySmartfren Apps for checking                   <br/>\r\n\r\nbalance, quota &amp; active period<br/>\r\n\r\nColor Options:<br/>\r\n\r\nBlue &amp; Brown<br/>\r\n\r\n<p class=MsoNormal>&nbsp;</p>\r\n\r\n<p class=MsoNormal><b>Benefit:</b><br/>\r\n\r\nFree Big Quota 30GB valid for 30 Days First Activation<br/>\r\n\r\n<p class=MsoNormal>&nbsp;<br/>\r\n\r\n<p class=MsoNormal><b>Note:</b></p>\r\n\r\nTop up Min 100 K Free Quota tambahan 2GB untuk 12X pengisian\r\natau 12 bulan mana lebih dahulu </p>', 'assets/img/product/new_andromax_m3z/image.png', '2', 'active', '2016-08-26 14:14:34', 'System', '2016-08-26 14:14:34', 'System');
INSERT INTO `product` VALUES ('18', 'Samsung Galaxy S7 Edge', '3', '<b>Spesifikasi:</b></p>\r\n\r\n<span lang=IN>Jaringan GSM / HSPA / LTE Kartu SIM Optional\r\nDual SIM (Nano-SIM, dual stand-by) <br/>Layar Tipe super AMOLED&nbsp;capacitive\r\ntouchscreen 16 juta warna, ukuran 5.5\"<br/>Resolusi 1440 x 2560\r\npixels,&nbsp;Corning Gorilla Glass (unspecified version), <br/>Multitouch Sistem\r\nOperasi Android OS, v6 (Marshmallow) <br/>Chipset Qualcomm MSM8996 Snapdragon 820<br/>\r\nExynos 8890 Octa Prosesor Dual-core 2.15 GHz &amp; dual-core 1.6 GHz<br/>\r\nQuad-core 2.3 GHz + quad-core 1.6 GHz GPU Adreno 530<br/>\r\nMali-T880 MP12 RAM 4 GB Memori Internal 32/64 GB,<br/>\r\nmicroSD, up to 200 GB (dedicated slot) – single SIM model<br/>\r\nmicroSD, up to 200 GB (uses SIM 2 slot) – dual SIM model <br/>Kamera Belakang 12 MP,\r\nf/1.7, 26mm, <br/>phase detection autofocus, OIS, LED flash<br/>\r\nDepan 5 MP, f/1.7, 22mm, dual video call, Auto HDR<br/>\r\nVideo 2160p@30fps, 1080p@60fps, 720p@120fps, HDR, dual-video rec<br/>\r\nFitur: 1/2.6&#8243; sensor size, 1.4 µm pixel size, geo-tagging, touch focus,\r\n<br/>face detection, Auto HDR, panorama <br/>Konektifitas Wi-Fi 802.11 a/b/g/n/ac,\r\ndual-band, Wi-Fi Direct, hotspot<br>\r\nBluetooth v4.2, A2DP, LE, apt-X<br>\r\nA-GPS, GLONASS, BDS<br>\r\nNFC<br>\r\nmicroUSB v2.0, USB Host Baterai Non-removable Li-Ion 3600 mAh battery<b> </b></span></p>\r\n\r\n<p class=MsoNormal><b>&nbsp;</b></p>\r\n\r\n<b>Benefit:</b></p>\r\n\r\n1GB<br/>\r\n\r\n100 Menit telepon ke sesama<br/>', 'assets/img/product/samsung_galaxy_s7_edge/image.png', '11', 'active', '2016-08-26 14:16:04', 'System', '2016-08-26 14:16:04', 'System');
INSERT INTO `product` VALUES ('19', 'Samsung Galaxy S7', '3', '<p class=MsoNormal><b>Spesifikasi:</b><br/>\r\n\r\n<p class=MsoNormal><span lang=IN>Jaringan GSM / HSPA / LTE Kartu SIM Nano-SIM<br/>\r\nLayar Tipe super AMOLED&nbsp;capacitive touchscreen 16 juta warna, ukuran\r\n5.1&#8243;, Resolusi 1440 x 2560 pixels,&nbsp;<br/>\r\nCorning Gorilla Glass(unspecified version), <br/>\r\nMultitouch Sistem Operasi Android OS, v6 (Marshmallow)<br/>\r\nChipset Qualcomm MSM8996 Snapdragon 820<br/>\r\nExynos 8890 Octa Prosesor Dual-core 2.15 GHz &amp; dual-core 1.6 GHz<br/>\r\nQuad-core 2.3 GHz + quad-core 1.6 GHz GPU Adreno 530<br/>\r\nMali-T880 MP12 RAM 4 GB Memori Internal 32/64 GB, <br/>\r\ndidukung kapasitas memori eksternal hingga 200 GB <br/>\r\nKamera Belakang 12 MP, f/1.7, phase detection<br/>\r\nautofocus, OIS, LED flash<br/>\r\nDepan 5 MP, f/1.7, dual video call, Auto HDR<br/>\r\nVideo&nbsp;2160p@30fps, 1080p@60fps, 720p@120fps<br/>\r\nHDR, dual-video rec<br/>\r\nFitur: 1/2.6&#8243; sensor size, 1.4 µm pixel size,<br/>\r\ngeo-tagging, touch focus<br/>\r\nface detection, Auto HDR, panorama <br/>\r\nKonektifitas Wi-Fi 802.11 a/b/g/n/ac<br/>\r\ndual-band, Wi-Fi Direct, hotspot<br/>\r\nBluetooth v4.2, A2DP, LE, apt-X<br/>\r\nA-GPS, GLONASS, BDS<br/>\r\nNFC<br/>\r\nmicroUSB v2.0, USB Host Baterai Non-removable Li-Ion 3000 mAh battery<b> </b></span><br/>\r\n\r\n<p class=MsoNormal>&nbsp;</p>\r\n\r\n<b>Benefit:</b><br/>\r\n\r\n1GB<br/>\r\n\r\n100 Menit telepon ke sesama<br/>', 'assets/img/product/samsung_galaxy_s7/image.png', '1', 'active', '2016-08-26 14:16:09', 'System', '2016-08-26 14:16:09', 'System');
